module.exports = "/*\nTheme Name:\nAuthor: yaminncco\n\nColors:\n    Body          : #868F9B\n    Headers     : #10161A\n    Primary     : #6195FF\n    Dark      : #FCFCFF\n    Grey          : #F4F4F4 #FAFAFA #EEE\n\nFonts: Montserrat Varela Round\n\nTable OF Contents\n------------------------------------\n1 > General\n2 > Logo\n3 > Navigation\n4 > Header\n5 > About\n6 > Portfolio\n7 > Services\n8 >  Why choose us\n9 >  Numbers\n10 > Pricing\n11 > Testimonial\n12 > Team\n13 > Blog\n14 > Blog post\n15 > Blog sidebar\n16 > Contact\n17 > Footer\n18 > Responsive\n19 > Owl theme\n20 > Back to top\n21 > Preloader\n\n------------------------------------*/\n\n/*------------------------------------*\\\n    General\n\\*------------------------------------*/\n\n\n/* -- typography -- */\n\nbody {\n    font-family: 'Varela Round', sans-serif;\n    font-size: 16px;\n    line-height: 1.6;\n    overflow-x: hidden;\n    color: #868F9B;\n}\n\nh1, h2, h3, h4, h5, h6 {\n    font-family: 'Montserrat', sans-serif;\n    font-weight: 700;\n    margin-top: 0px;\n    margin-bottom: 20px;\n    color: #10161A;\n}\n\n::-webkit-input-placeholder { /* Chrome, Firefox, Opera, Safari 10.1+ */\n    color: #000000;\n    opacity: 1; /* Firefox */\n}\n\n:-ms-input-placeholder { /* Chrome, Firefox, Opera, Safari 10.1+ */\n    color: #000000;\n    opacity: 1; /* Firefox */\n}\n\n::placeholder { /* Chrome, Firefox, Opera, Safari 10.1+ */\n    color: #000000;\n    opacity: 1; /* Firefox */\n}\n\nh1 {\n    font-size: 54px;\n}\n\nh2 {\n    font-size: 36px;\n}\n\nh3 {\n    font-size: 21px;\n}\n\nh4 {\n    font-size: 18px;\n}\n\nh5 {\n    font-size: 16px;\n}\n\na {\n    color: #6195FF;\n    text-decoration: none;\n    transition: 0.2s opacity;\n}\n\na:hover, a:focus {\n    text-decoration: none;\n    outline: none;\n    opacity: 0.8;\n    color: #6195FF;\n}\n\n.main-color {\n    color: #6195FF;\n}\n\n.white-text {\n    color: #FFF;\n}\n\n::-moz-selection {\n    background-color: #6195FF;\n    color: #FFF;\n}\n\n::selection {\n    background-color: #6195FF;\n    color: #FFF;\n}\n\n.mouse{ cursor: pointer; }\n\nul, ol {\n    margin: 0;\n    padding: 0;\n    list-style: none\n}\n\n/* -- section  -- */\n\n.section {\n    position: relative;\n}\n\n.md-padding {\n    padding-top: 120px;\n    padding-bottom: 120px;\n}\n\n.sm-padding {\n    padding-top: 60px;\n    padding-bottom: 60px;\n}\n\n\n/* --  background section  -- */\n\n.bg-grey {\n    background-color: #FAFAFA;\n    border-top: 1px solid #EEE;\n    border-bottom: 1px solid #EEE;\n}\n\n.bg-dark {\n    background-color: #1C1D21;\n}\n\n\n/* --  background image section  -- */\n\n.bg-img {\n    position: absolute;\n    left: 0;\n    top: 0;\n    right: 0;\n    bottom: 0;\n    z-index: -1;\n    /*background-position: center;*/\n    background-size: cover;\n    background-attachment: fixed;\n}\n\n.bg-img .overlay {\n    position: absolute;\n    left: 0;\n    top: 0;\n    right: 0;\n    bottom: 0;\n    opacity: .8;\n    background: #1C1D21;\n}\n\n\n/* --  section header  -- */\n\n.section-header {\n    position: relative;\n    margin-bottom: 60px;\n}\n\n.section-header .title {\n    text-transform: capitalize;\n}\n\n.title:after {\n    content:\"\";\n    display:block;\n    height:4px;\n    width:40px;\n    background-color: #6195FF;\n    margin-top: 20px;\n}\n\n.text-center .title:after {\n    margin: 20px auto 0px;\n}\n\n/* --  Input  -- */\n\ninput[type=\"text\"], input[type=\"email\"], input[type=\"password\"], input[type=\"number\"], input[type=\"date\"], input[type=\"url\"], input[type=\"tel\"], textarea {\n    height: 40px;\n    width: 100%;\n    border: none;\n      background: #F4F4F4;\n    border-bottom: 2px solid #EEE;\n    color: #354052;\n    padding: 0px 10px;\n    opacity: 0.5;\n    transition: 0.2s border-color, 0.2s opacity;\n}\n\ntextarea {\n    padding: 10px 10px;\n    min-height: 80px;\n    resize: vertical;\n}\n\ninput[type=\"text\"]:focus, input[type=\"email\"]:focus, input[type=\"password\"]:focus, input[type=\"number\"]:focus, input[type=\"date\"]:focus, input[type=\"url\"]:focus, input[type=\"tel\"]:focus, textarea:focus {\n    border-color: #6195FF;\n    opacity: 1;\n}\n\n/* --  Buttons  -- */\n\n.main-btn, .white-btn, .outline-btn {\n    display: inline-block;\n    padding: 10px 35px;\n    margin: 3px;\n    border: 2px solid transparent;\n    border-radius: 3px;\n    transition: 0.2s opacity;\n}\n\n.main-btn {\n    background: #6195FF;\n    color: #FFF;\n}\n\n.white-btn {\n    background: #FFF;\n    color: #10161A !important;\n}\n\n.outline-btn {\n    background: transparent;\n    color: #6195FF !important;\n    border-color: #6195FF;\n}\n\n.main-btn:hover, .white-btn:hover, .outline-btn:hover {\n    opacity: 0.8;\n}\n\n\n/*------------------------------------*\\\n    Logo\n\\*------------------------------------*/\n\n.navbar-brand {\n    padding: 0;\n}\n\n.navbar-brand .logo, .navbar-brand .logo-alt {\n    max-height: 80px;\n    display: block;\n}\n\n#nav:not(.nav-transparent):not(.fixed-nav) .navbar-brand .logo-alt {\n    display: none;\n}\n\n#nav.nav-transparent:not(.fixed-nav) .navbar-brand .logo {\n    display: none;\n}\n\n#nav.fixed-nav .navbar-brand .logo-alt {\n    display: none;\n}\n\n@media only screen and (max-width: 767px) {\n    #nav.nav-transparent .navbar-brand .logo-alt {\n        display: none !important;\n    }\n    #nav.nav-transparent .navbar-brand .logo {\n        display: block !important;\n    }\n}\n\n\n/*------------------------------------*\\\n    Navigation\n\\*------------------------------------*/\n\n#nav {\n    padding: 10px 0px;\n    background: #FFF;\n    transition: 0.2s padding;\n    z-index: 999;\n}\n\n#nav.navbar {\n    border: none;\n    border-radius: 0;\n    margin-bottom: 0px;\n}\n\n#nav.fixed-nav {\n    position: fixed;\n    left: 0;\n    right: 0;\n    padding: 0px 0px;\n    background-color: #FFF !important;\n    border-bottom: 1px solid #EEE;\n}\n\n#nav.nav-transparent {\n    background: transparent;\n}\n\n\n/* -- default nav -- */\n\n@media only screen and (min-width: 768px) {\n    .main-nav li {\n        padding: 0px 15px;\n    }\n    .main-nav li a {\n        font-size: 14px;\n        transition: 0.2s color;\n    }\n    .main-nav>li>a {\n        color: #10161A;\n        padding: 15px 0px;\n    }\n    #nav.nav-transparent:not(.fixed-nav) .main-nav>li>a {\n        color: #fff;\n    }\n    .main-nav>li>a:hover, .main-nav>li>a:focus, .main-nav>li.active>a {\n        background: transparent;\n        color: #6195FF;\n    }\n    .main-nav>li>a:after {\n        content: \"\";\n        display: block;\n        background-color: #6195FF;\n        height: 2px;\n        width: 0%;\n        transition: 0.2s width;\n    }\n    .main-nav>li>a:hover:after, .main-nav>li.active>a:after {\n        width: 100%;\n    }\n    /* dropdown */\n    .has-dropdown {\n        position: relative;\n    }\n    .has-dropdown>a:before {\n        font-family: 'FontAwesome';\n        content: \"\\f054\";\n        font-size: 6px;\n        margin-left: 6px;\n        float: right;\n        -webkit-transform: rotate(90deg);\n        transform: rotate(90deg);\n        transition: 0.2s -webkit-transform;\n        transition: 0.2s transform;\n        transition: 0.2s transform, 0.2s -webkit-transform;\n    }\n    .dropdown {\n        position: absolute;\n        right: -50%;\n        top: 0;\n        background-color: #6195FF;\n        width: 200px;\n        box-shadow: 0px 5px 5px -5px rgba(53, 64, 82, 0.2);\n        -webkit-transform: translateY(15px) translateX(50%);\n        transform: translateY(15px) translateX(50%);\n        opacity: 0;\n        visibility: hidden;\n        transition: 0.2s all;\n    }\n    .main-nav>.has-dropdown>.dropdown {\n        top: 100%;\n        right: 50%;\n    }\n    .main-nav>.has-dropdown>.dropdown .dropdown.dropdown-left {\n        right: 150%;\n    }\n    .dropdown li a {\n        display: block;\n        color: #FFF;\n        border-top: 1px solid rgba(250, 250, 250, 0.1);\n        padding: 10px 0px;\n    }\n    .dropdown li:nth-child(1) a {\n        border-top: none;\n    }\n    .has-dropdown:hover>.dropdown {\n        opacity: 1;\n        visibility: visible;\n        -webkit-transform: translateY(0px) translateX(50%);\n        transform: translateY(0px) translateX(50%);\n    }\n    .has-dropdown:hover>a:before {\n        -webkit-transform: rotate(0deg);\n        transform: rotate(0deg);\n    }\n    .nav-collapse {\n        display: none;\n    }\n}\n\n\n/* -- mobile nav -- */\n\n@media only screen and (max-width: 767px) {\n    #nav {\n        padding: 0px 0px;\n    }\n    #nav.nav-transparent {\n        background: #FFF;\n    }\n    .main-nav {\n        position: fixed;\n        right: 0;\n        height: calc(100vh - 80px);\n        box-shadow: 0px 80px 0px 0px #1C1D21;\n        max-width: 250px;\n        width: 0%;\n        -webkit-transform: translateX(100%);\n        transform: translateX(100%);\n        margin: 0;\n        overflow-y: auto;\n        background: #1C1D21;\n        transition: 0.2s all;\n    }\n    #nav.open .main-nav {\n        -webkit-transform: translateX(0%);\n        transform: translateX(0%);\n        width: 100%;\n    }\n    .main-nav li {\n        border-top: 1px solid rgba(250, 250, 250, 0.1);\n    }\n    .main-nav li a {\n        display: block;\n        color: #FFF;\n        transition: 0.2s all;\n    }\n    .main-nav>li.active {\n        border-left: 6px solid #6195FF;\n    }\n    .main-nav li a:hover, .main-nav li a:focus {\n        background-color: #6195FF;\n        color: #FFF;\n        opacity: 1;\n    }\n    .has-dropdown>a:after {\n        content: \"\\f054\";\n        font-family: 'FontAwesome';\n        float: right;\n        transition: 0.2s -webkit-transform;\n        transition: 0.2s transform;\n        transition: 0.2s transform, 0.2s -webkit-transform;\n    }\n    .dropdown {\n        opacity: 0;\n        visibility: hidden;\n        height: 0;\n        background: rgba(250, 250, 250, 0.1);\n    }\n    .dropdown li a {\n        padding: 6px 10px;\n    }\n    .has-dropdown.open-drop>a:after {\n        -webkit-transform: rotate(90deg);\n        transform: rotate(90deg);\n    }\n    .has-dropdown.open-drop>.dropdown {\n        opacity: 1;\n        visibility: visible;\n        height: auto;\n        transition: 0.2s all;\n    }\n}\n\n\n/* -- nav btn collapse -- */\n\n.nav-collapse {\n    position: relative;\n    float: right;\n    width: 40px;\n    height: 40px;\n    margin-top: 5px;\n    margin-right: 5px;\n    cursor: pointer;\n    z-index: 99999;\n}\n\n.nav-collapse span {\n    display: block;\n    -webkit-transform: translate(-50%, -50%);\n    transform: translate(-50%, -50%);\n    position: absolute;\n    top: 50%;\n    left: 50%;\n    width: 25px;\n}\n\n.nav-collapse span:before, .nav-collapse span:after {\n    content: \"\";\n    display: block;\n}\n\n.nav-collapse span, .nav-collapse span:before, .nav-collapse span:after {\n    height: 4px;\n    background: #10161A;\n    transition: 0.2s all;\n}\n\n.nav-collapse span:before {\n    -webkit-transform: translate(0%, 10px);\n    transform: translate(0%, 10px);\n}\n\n.nav-collapse span:after {\n    -webkit-transform: translate(0%, -14px);\n    transform: translate(0%, -14px);\n}\n\n#nav.open .nav-collapse span {\n    background: transparent;\n}\n\n#nav.open .nav-collapse span:before {\n    -webkit-transform: translateY(0px) rotate(-135deg);\n    transform: translateY(0px) rotate(-135deg);\n}\n\n#nav.open .nav-collapse span:after {\n    -webkit-transform: translateY(-4px) rotate(135deg);\n    transform: translateY(-4px) rotate(135deg);\n}\n\n\n/*------------------------------------*\\\n    Header\n\\*------------------------------------*/\n\nheader {\n    position: relative;\n}\n\n#home {\n    height: 100vh;\n}\n\n#home .home-wrapper {\n    position: absolute;\n    left: 0px;\n    right: 0px;\n    top: 50%;\n    -webkit-transform: translateY(-50%);\n    transform: translateY(-50%);\n    text-align: center;\n}\n\n.home-content h1 {\n  text-transform: uppercase;\n}\n.home-content button {\n  margin-top: 20px;\n}\n\n.header-wrapper h2 {\n    display: inline-block;\n    margin-bottom: 0px;\n}\n\n.header-wrapper .breadcrumb {\n    float: right;\n    background: transparent;\n    margin-bottom: 0px;\n}\n\n.header-wrapper .breadcrumb .breadcrumb-item.active {\n    color: #868F9B;\n}\n\n.breadcrumb>li+li:before {\n    color: #868F9B;\n}\n\n\n/*------------------------------------*\\\n    About\n\\*------------------------------------*/\n\n.about {\n    position: relative;\n    text-align: center;\n    padding: 40px 20px;\n    border: 1px solid #EEE;\n    margin: 15px 0px;\n}\n\n.about i {\n    font-size: 36px;\n    color: #6195FF;\n    margin-bottom: 20px;\n}\n\n.about:after {\n    content: \"\";\n    background-color: #1C1D21;\n    position: absolute;\n    left: 0;\n    top: 0;\n    bottom: 0;\n    width: 0%;\n    z-index: -1;\n    transition: 0.2s width;\n}\n\n.about:hover:after {\n    width: 100%;\n}\n\n.about h3 {\n    transition: 0.2s color;\n}\n\n.about:hover h3 {\n    color: #fff;\n}\n\n\n/*------------------------------------*\\\n    Portfolio\n\\*------------------------------------*/\n\n.work {\n    position: relative;\n    padding: 20px;\n}\n\n.work>img {\n  width: 100%;\n}\n\n.work .overlay {\n    background: #1C1D21;\n    position: absolute;\n    top: 0px;\n    left: 0px;\n    right: 0px;\n    bottom: 0px;\n    opacity: 0;\n    transition: 0.2s opacity;\n    transition-delay: 0.2s;\n}\n\n.work:hover .overlay {\n    transition-delay: 0s;\n    opacity: 0.8;\n}\n\n.work .work-content {\n    position: absolute;\n    left: 25px;\n    right: 25px;\n    top: 50%;\n    text-align: center;\n    -webkit-transform: translateY(-50%);\n    transform: translateY(-50%);\n}\n\n.work .work-content h3 {\n    -webkit-transform: translateY(100%);\n    transform: translateY(100%);\n    opacity: 0;\n    color: #FFF;\n    margin-bottom: 10px;\n    transition: 0.2s all;\n    transition-delay: 0.1s;\n}\n\n.work:hover .work-content h3 {\n    -webkit-transform: translateY(0%);\n    transform: translateY(0%);\n    opacity: 1;\n    transition-delay: 0.1s;\n}\n\n.work .work-content span {\n    display: block;\n    text-transform: uppercase;\n    -webkit-transform: translateY(100%);\n    transform: translateY(100%);\n    opacity: 0;\n    color: #6195FF;\n    margin-bottom: 5px;\n    transition: 0.2s all;\n    transition-delay: 0.2s;\n}\n\n.work:hover .work-content span {\n    -webkit-transform: translateY(0%);\n    transform: translateY(0%);\n    opacity: 1;\n    transition-delay: 0s;\n}\n\n.work .work-link {\n    text-align: center;\n    margin-top: 20px;\n    opacity: 0;\n    transition: 0.2s opacity;\n}\n\n.work .work-link a {\n    display: inline-block;\n    width: 50px;\n    height: 50px;\n    background-color: #6195FF;\n    color: #FFF;\n    line-height: 50px;\n    text-align: center;\n}\n\n.work:hover .work-link {\n    transition-delay: 0.2s;\n    opacity: 1;\n}\n\n\n/*------------------------------------*\\\n    Services\n\\*------------------------------------*/\n\n.service {\n    position: relative;\n    padding: 40px 20px 40px 70px;\n    margin: 15px 0px;\n    border: 1px solid #EEE;\n}\n\n.service i {\n    position: absolute;\n    left: 20px;\n    text-align: center;\n    font-size: 32px;\n    color: #6195FF;\n    border-radius: 50%;\n}\n\n.service:after {\n    content: \"\";\n    background-color: #1C1D21;\n    position: absolute;\n    left: 0;\n    top: 0;\n    bottom: 0;\n    width: 0%;\n    z-index: -1;\n    transition: 0.2s width;\n}\n\n.service:hover:after {\n    width: 100%;\n}\n\n.service h3 {\n  transition: 0.2s color;\n}\n\n.service:hover h3 {\n    color: #fff;\n}\n\n/*------------------------------------*\\\n    Why choose us\n\\*------------------------------------*/\n\n.feature {\n    margin: 15px 0px;\n}\n.feature i {\n    float: left;\n    padding: 5px;\n    border-radius: 50%;\n    color: #6195FF;\n    border: 1px solid #6195FF;\n    margin-right: 5px;\n}\n\n/*------------------------------------*\\\n    Numbers\n\\*------------------------------------*/\n\n.number {\n    text-align: center;\n    margin: 15px 0px;\n}\n\n.number i {\n    color: #6195FF;\n    font-size: 36px;\n    margin-bottom: 20px;\n}\n\n.number h3 {\n    font-size: 36px;\n    margin-bottom: 10px;\n}\n\n\n/*------------------------------------*\\\n    Pricing\n\\*------------------------------------*/\n\n.pricing {\n    position: relative;\n    text-align: center;\n    border: 1px solid #EEE;\n    background-color: #FFF;\n    z-index: 11;\n    margin: 15px 0px;\n}\n\n.pricing::after {\n    content: \"\";\n    background-color: #1C1D21;\n    position: absolute;\n    left: 0;\n    right: 0;\n    top: 0;\n    height: 0%;\n    z-index: -1;\n    transition: 0.2s height;\n}\n\n.pricing:hover:after {\n    height: 100%;\n}\n\n.pricing .price-head {\n    position: relative;\n    margin-bottom: 20px;\n}\n\n.pricing .price-title {\n    display: block;\n    padding: 40px 0px 20px;\n    text-transform: uppercase;\n    transition: 0.2s color;\n}\n\n.pricing:hover .price-title {\n    color: #6195FF;\n}\n\n.pricing .price {\n    position: relative;\n    width: 140px;\n    height: 140px;\n    line-height: 140px;\n    text-align: center;\n    margin: auto;\n    border-radius: 50%;\n    border: 2px solid #6195FF;\n}\n\n.pricing .price h3 {\n  font-size: 42px;\n  margin: 0px;\n  transition: 0.2s color;\n  -webkit-transform: translateY(-50%);\n          transform: translateY(-50%);\n  top: 50%;\n  position: absolute;\n  left: 0;\n  right: 0;\n}\n\n.pricing:hover .price h3 {\n    color: #fff;\n}\n\n.pricing .duration {\n    display: block;\n    font-size: 14px;\n    text-transform: uppercase;\n    color: #10161A;\n    transition: 0.2s color;\n}\n\n.pricing:hover .duration {\n    color: #fff;\n}\n\n.pricing .price-btn {\n    padding-top: 20px;\n    padding-bottom: 40px;\n}\n\n/*------------------------------------*\\\n    Testimonial\n\\*------------------------------------*/\n\n.testimonial {\n    margin: 15px 0px;\n}\n\n.testimonial-meta {\n    position: relative;\n    padding-left: 90px;\n    height: 70px;\n    margin-bottom: 20px;\n    padding-top: 10px;\n}\n\n.testimonial img {\n    position: absolute;\n    left: 0;\n    top: 0;\n    width: 70px !important;\n    height: 70px !important;\n    border-radius: 50%;\n}\n\n.testimonial h3 {\n    margin-bottom: 5px;\n}\n\n.testimonial span {\n    font-size: 14px;\n    color: #6195FF;\n    text-transform: uppercase;\n}\n\n\n/*------------------------------------*\\\n    Team\n\\*------------------------------------*/\n\n.team {\n    position: relative;\n    background-color: #F4F4F4;\n    padding: 40px 20px;\n    margin: 15px 0px;\n}\n\n.team::after {\n    content: \"\";\n    background-color: #1C1D21;\n    position: absolute;\n    left: 0;\n    right: 0;\n    top: 0;\n    height: 0%;\n    z-index: 1;\n    transition: 0.2s height;\n}\n\n.team:hover:after {\n    height: 100%;\n}\n\n.team-img {\n    position: relative;\n    margin-bottom: 20px;\n    z-index: 11;\n}\n\n.team-img>img {\n  width: 100%;\n}\n\n.team .overlay {\n    background: #1C1D21;\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    right: 0;\n    top: 0;\n    opacity: 0;\n    transition: 0.2s opacity;\n}\n\n.team:hover .overlay {\n    opacity: 0.8;\n}\n\n.team .team-content {\n    text-align: center;\n    position: relative;\n    z-index: 11;\n}\n\n.team .team-content h3 {\n    margin-bottom: 10px;\n    transition: 0.2s color;\n}\n\n.team .team-content span {\n    font-size: 14px;\n    text-transform: uppercase;\n    transition: 0.2s color;\n}\n\n.team:hover .team-content h3 {\n    color: #FFF;\n}\n\n.team:hover .team-content span {\n    color: #6195FF;\n}\n\n.team .team-social {\n    position: absolute;\n    top: 0;\n    right: 0;\n    opacity: 0;\n    transition: 0.2s opacity;\n}\n\n.team .team-social a {\n    display: block;\n    line-height: 50px;\n    width: 50px;\n    text-align: center;\n    background-color: #6195FF;\n    color: #FFF;\n}\n\n.team:hover .team-social {\n    opacity: 1;\n}\n\n\n/*------------------------------------*\\\n    Blog\n\\*------------------------------------*/\n\n.blog {\n    background-color: #FFF;\n    margin: 15px 0px;\n}\n\n.blog .blog-content {\n    padding: 20px 20px 40px;\n}\n\n.blog .blog-meta {\n    margin-bottom: 20px;\n}\n\n.blog .blog-meta li {\n    display: inline-block;\n    font-size: 14px;\n    color: #10161A;\n    margin-right: 10px;\n}\n\n.blog .blog-meta li i {\n    color: #6195FF;\n    margin-right: 5px;\n}\n\n/*------------------------------------*\\\n    Blog post\n\\*------------------------------------*/\n\n#main .blog .blog-content {\n  padding: 20px 0px 0px;\n}\n\n#main .blog {\n  margin-top: 0px;\n}\n\n/* -- blog tags -- */\n\n.blog-tags {\n    margin: 40px 0px;\n}\n\n.blog-tags h5 {\n    margin-bottom: 0;\n    display: inline-block;\n}\n\n.blog-tags a {\n    display: inline-block;\n    padding: 6px 13px;\n    font-size: 14px;\n    margin: 2px 0px;\n    background: #F4F4F4;\n    color: #10161A;\n}\n\n.blog-tags a:hover {\n  color: #FFF;\n  background-color: #6195FF;\n}\n\n.blog-tags a i {\n    margin-right: 3px;\n    color: #6195FF;\n}\n\n.blog-tags a:hover i {\n  color: #FFF;\n}\n\n\n/* -- blog author -- */\n\n.blog-author {\n    margin: 40px 0px;\n}\n\n.blog-author .media .media-left {\n    padding-right: 20px;\n}\n\n.blog-author .media {\n    padding: 20px;\n    border: 1px solid #EEE;\n}\n\n.blog-author .media .media-heading {\n    padding-bottom: 20px;\n    margin-bottom: 20px;\n    border-bottom: 1px solid #EEE;\n}\n\n.blog-author .media .media-heading h3 {\n    display: inline-block;\n    margin: 0;\n    text-transform: uppercase;\n}\n\n.blog-author .media .media-heading .author-social {\n  float: right;\n}\n\n.blog-author .author-social a {\n    display: inline-block;\n    width: 24px;\n    height: 24px;\n    text-align: center;\n    line-height: 24px;\n    border-radius: 3px;\n    margin-left: 5px;\n    color: #FFF;\n    background-color: #6195FF;\n}\n\n/* -- blog comments -- */\n\n.blog-comments {\n    margin: 40px 0px;\n}\n\n.blog-comments .media {\n    padding: 20px;\n    background-color: #FFF;\n    border-top: 1px solid #EEE;\n    border-bottom: 0px;\n    border-right: 1px solid #EEE;\n    border-left: 1px solid #EEE;\n    margin-top: 0px;\n}\n\n.blog-comments .media:first-child {\n    border-bottom: 0px;\n}\n\n.blog-comments .media:last-child {\n    border-bottom: 1px solid #EEE;\n}\n\n.blog-comments .media .media-left {\n  padding-right: 20px;\n}\n\n.blog-comments .media .media-body .media-heading {\n    text-transform: uppercase;\n    margin-bottom:10px;\n}\n\n.blog-comments .media .media-body .media-heading .time {\n    font-size: 12px;\n    margin-left: 20px;\n    font-weight: 400;\n    color: #868F9B;\n}\n\n.blog-comments .media .media-body .media-heading .reply {\n    float: right;\n    margin: 0;\n    font-size: 12px;\n    text-transform: uppercase;\n    font-weight: 400;\n}\n\n.blog-comments .media.author {\n    background-color: #F4F4F4;\n    border-color: #6195FF;\n    border-bottom: 1px solid #6195FF;\n}\n.blog-comments .media.author>.media-body>.media-heading {\n    color: #6195FF;\n}\n\n.blog-comments .media.author + .media {\n    border-top: 0px;\n}\n\n/* blog reply form */\n\n.reply-form {\n    margin: 40px 0px;\n}\n\n.reply-form form .input, .reply-form form .input , .reply-form form textarea {\n    margin-bottom:20px;\n}\n\n.reply-form form .input, .reply-form form .input {\n    width: calc(50% - 10px);\n    display: inline-block;\n}\n\n.reply-form form .input:nth-child(2) {\n    margin-left: 15px;\n}\n\n\n/*------------------------------------*\\\n    Blog sidebar\n\\*------------------------------------*/\n\n#aside .widget {\n    margin-bottom: 40px;\n}\n\n.widget h3 {\n  text-transform: uppercase;\n}\n\n/* -- search sidebar -- */\n\n#aside .widget-search {\n    position: relative;\n}\n\n#aside .widget-search .search-input {\n    padding-right: 50px;\n}\n\n#aside .widget-search .search-btn {\n    position: absolute;\n    right: 0px;\n      bottom: 0px;\n    width: 40px;\n    height: 40px;\n    border: none;\n    line-height: 40px;\n    background-color: transparent;\n    color: #6195FF;\n}\n\n/* -- category sidebar -- */\n\n.widget-category a {\n    display: block;\n    font-size: 14px;\n    color: #354052;\n    border-bottom: 1px solid #EEE;\n    padding: 5px;\n}\n\n.widget-category a:nth-child(1) {\n  border-top: 1px solid #EEE;\n}\n\n.widget-category a span {\n    float: right;\n    color: #6195FF;\n}\n\n.widget-category a:hover {\n    color: #6195FF;\n}\n\n/* -- tags sidebar -- */\n\n.widget-tags a {\n  display: inline-block;\n  padding: 6px 13px;\n  font-size: 14px;\n  margin: 2px 0px;\n  background: #F4F4F4;\n  color: #10161A;\n}\n\n.widget-tags a:hover {\n  color: #FFF;\n  background-color: #6195FF;\n}\n\n/* -- posts sidebar -- */\n\n.widget-post {\n    min-height: 70px;\n    margin-bottom: 25px;\n}\n\n.widget-post img {\n    display: block;\n    float: left;\n    margin-right: 10px;\n    margin-top: 5px;\n}\n\n.widget-post a {\n    display: block;\n    color: #10161A;\n}\n\n.widget-post a:hover {\n    color: #6195FF;\n}\n\n.widget-post .blog-meta {\n    display: inline-block;\n}\n\n.widget-post .blog-meta li {\n    display: inline-block;\n    margin-right: 5px;\n    color: #6195FF;\n    font-size: 12px;\n}\n\n.widget-post li i {\n    color: #6195FF;\n    margin-right: 5px;\n}\n\n\n\n/*------------------------------------*\\\n    Contact\n\\*------------------------------------*/\n\n.contact {\n    margin: 15px 0px;\n    text-align: center;\n}\n\n.contact i {\n    font-size: 36px;\n    color: #6195FF;\n    margin-bottom: 20px;\n}\n\n.contact-form {\n    text-align: center;\n    margin-top: 40px;\n}\n\n.contact-form .input {\n    margin-bottom: 20px;\n}\n\n\n.contact-form .input:nth-child(1), .contact-form .input:nth-child(2) {\n    width: calc(50% - 10px);\n}\n\n.contact-form .input:nth-child(2) {\n    margin-left: 15px;\n}\n\n/*------------------------------------*\\\n    Footer\n\\*------------------------------------*/\n\n#footer {\n    position: relative;\n}\n\n.footer-logo {\n    text-align: center;\n    margin-bottom: 40px;\n}\n\n.footer-logo>a>img {\n    max-height: 80px;\n}\n\n.footer-follow {\n    text-align: center;\n    margin-bottom: 20px;\n}\n\n.footer-follow li {\n    display: inline-block;\n    margin-right: 10px;\n    margin-bottom: 13px;\n}\n\n.footer-follow li a {\n  display: inline-block;\n  width: 50px;\n  height: 50px;\n  line-height: 50px;\n  text-align: center;\n  border-radius: 3px;\n  background-color: #6195FF;\n  color:#FFF;\n}\n\n.footer-copyright p {\n    text-align: center;\n    font-size: 14px;\n    text-transform: uppercase;\n    margin: 0;\n}\n\n\n/*------------------------------------*\\\n    Responsive\n\\*------------------------------------*/\n\n\n@media only screen and (max-width: 991px) {}\n\n@media only screen and (max-width: 767px) {\n  .section-header h2.title {\n        font-size:31.5px;\n    }\n\n  .main-btn , .default-btn , .outline-btn , .white-btn  {\n        padding: 8px 22px;\n        font-size:14px;\n    }\n\n  .home-content h1 {\n        font-size:36px;\n    }\n\n  .header-wrapper h2 {\n      margin-bottom: 20px;\n      text-align: center;\n      display: block;\n  }\n\n  .header-wrapper .breadcrumb {\n      float: none;\n      text-align: center;\n  }\n}\n\n@media only screen and (max-width: 480px) {\n  #portfolio [class*='col-xs'] {\n          width:100%;\n    }\n\n  #numbers [class*='col-xs'] {\n          width:100%;\n    }\n\n  .contact-form .input:nth-child(1), .contact-form .input:nth-child(2) {\n      width: 100%;\n  }\n  .contact-form .input:nth-child(2) {\n      margin-left: 0px;\n  }\n\n  .reply-form form .input, .reply-form form .input {\n      width: 100%;\n  }\n  .reply-form form .input:nth-child(2) {\n      margin-left: 0px;\n  }\n\n\n\n  .blog-author .media .media-left {\n      display: block;\n      padding-right: 0;\n      margin-bottom: 20px;\n  }\n  .blog-author .media {\n      text-align: center;\n  }\n  .blog-author .media .media-heading .author-social {\n      margin-top: 10px;\n      float: none;\n  }\n  .blog-author .media .media-left img {\n      margin: auto;\n  }\n\n  .blog-comments .media .media {\n      margin:0px -15px;\n  }\n}\n\n\n\n/*------------------------------------*\\\n    Owl theme\n\\*------------------------------------*/\n\n/* -- dots -- */\n\n.owl-theme .owl-dots .owl-dot span {\n    border: none;\n    background: #EEE;\n    transition: 0.2s all;\n}\n\n.owl-theme .owl-dots .owl-dot:hover span {\n    background: #6195FF;\n}\n.owl-theme .owl-dots .owl-dot.active span {\n      background: #6195FF;\n      width:20px;\n}\n\n/* -- nav -- */\n\n.owl-theme .owl-nav {\n    opacity: 0;\n    transition: 0.2s opacity;\n}\n\n.owl-theme:hover .owl-nav {\n    opacity: 1;\n}\n\n.owl-theme .owl-nav [class*='owl-'] {\n    position: absolute;\n    top: 50%;\n    -webkit-transform: translateY(-50%);\n            transform: translateY(-50%);\n    background: #6195FF;\n    color: #FFF;\n    padding: 0px;\n    width: 50px;\n    height: 50px;\n    border-radius:3px;\n    line-height: 50px;\n    margin: 0;\n}\n\n.owl-theme .owl-prev {\n    left: 0px;\n}\n\n.owl-theme .owl-next {\n    right: 0px;\n}\n\n.owl-theme .owl-nav [class*='owl-']:hover {\n    opacity: 0.8;\n    background: #6195FF;\n}\n\n\n/*------------------------------------*\\\n    Back to top\n\\*------------------------------------*/\n\n#back-to-top {\n    display:none;\n    position: fixed;\n    bottom: 20px;\n    right: 20px;\n    width: 50px;\n    height: 50px;\n    line-height: 50px;\n    text-align: center;\n    background: #6195FF;\n    border-radius:3px;\n    color: #FFF;\n    z-index: 9999;\n    transition: 0.2s opacity;\n    cursor: pointer;\n}\n\n#back-to-top:after {\n    content: \"\\f106\";\n    font-family: 'FontAwesome';\n}\n\n#back-to-top:hover {\n    opacity: 0.8;\n}\n\n/*------------------------------------*\\\n    Preloader\n\\*------------------------------------*/\n\n\n#preloader {\n    position: fixed;\n    left: 0;\n    top: 0;\n    bottom: 0;\n    right: 0;\n    background-color: #FFF;\n    z-index: 99999;\n}\n\n.preloader {\n    position: absolute;\n    left: 50%;\n    top: 50%;\n    -webkit-transform: translate(-50%, -50%);\n            transform: translate(-50%, -50%);\n}\n.preloader span {\n    display: inline-block;\n    background-color: #6195FF;\n    width: 25px;\n    height: 25px;\n    -webkit-animation: 1s preload ease-in-out infinite;\n            animation: preload 1s ease-in-out infinite;\n    -webkit-transform: scale(0);\n            transform: scale(0);\n    border-radius:50%;\n}\n\n.preloader span:nth-child(1) {\n    -webkit-animation-delay: 0s;\n            animation-delay: 0s;\n}\n\n.preloader span:nth-child(2) {\n    -webkit-animation-delay: 0.1s;\n            animation-delay: 0.1s;\n}\n\n.preloader span:nth-child(3) {\n    -webkit-animation-delay: 0.15s;\n            animation-delay: 0.15s;\n}\n\n.preloader span:nth-child(4) {\n    -webkit-animation-delay: 0.2s;\n            animation-delay: 0.2s;\n}\n\n@-webkit-keyframes preload {\n    0% {\n       -webkit-transform:scale(0);\n               transform:scale(0);\n    }\n  50% {\n    -webkit-transform:scale(1);\n            transform:scale(1);\n  }\n  100% {\n    -webkit-transform:scale(0);\n            transform:scale(0);\n  }\n}\n\n@keyframes preload {\n    0% {\n       -webkit-transform:scale(0);\n               transform:scale(0);\n    }\n  50% {\n    -webkit-transform:scale(1);\n            transform:scale(1);\n  }\n  100% {\n    -webkit-transform:scale(0);\n            transform:scale(0);\n  }\n}\n"

